import React from 'react';
import Resume from './Images/Grey Clean CV Resume Photo_page-0001.jpg';

const Experience = () => {
  return (
    <div className="bg-color ">
      <div className="content">
        <h1>RESUME</h1>
        <p>
          Lorem ipsum Exercitation culpa qui dolor consequat exercitation fugiat
          <br></br> laborum ex ea eiusmod ad do aliqua occaecat nisi ad irure
          sunt id pariatur Duis laboris amet
        </p>
        <h1>Work Experience</h1>

        <img src={Resume} />
      </div>
    </div>
  );
};

export default Experience;
